import React from 'react';
import '../css/Filter.css';
const Filter = () => {
	return (
		<div className='Filter--comp'>
			<ul className='filters'>
				<li>all todos</li>
				<li>waitings</li>
				<li>inprogresses</li>
				<li>completed</li>
			</ul>

		</div>
	);
};

export default Filter;
